import './components/Borrow.css';
import Borrow from "./components/Borrow";
import BankRates from "./components/BankRates";

function App() {
  return (
    <div>
      <h2> </h2>
      <CurrDate></CurrDate>
      <h2> </h2>
      <BankRates></BankRates>

      <div>
        <Borrow></Borrow>
      </div>
    </div>
  );
}

export default App;
